import React from "react";

const HeaderUser = () => {
  return (
    <div>
      <header>
        <nav className="navbar navbar-dark bg-primary">
          <a href="http://localhost:3000/" className="navbar-brand">
            Home
          </a>
          <a href="http://localhost:3000/addFriend" className="navbar-brand">
            Add Friend
          </a>
        </nav>
      </header>
    </div>
  );
};

export default HeaderUser;
